import React from "react";
import { cn } from "../utils/cn";

const FileTree = ({ isDragging, width }) => {
  return (
    <div className={cn("shrink-0 contents", isDragging && "dragging")} style={{ width }}>
      File Tree
    </div>
  );
};

export default FileTree;
